import React from "react";
import { View, Image } from "react-native";
import styles from "./styles";

const ProfilePicture = () => {
  return (
    <View>
      <Image
        style={styles.image}
        source={{
          uri: "https://homepages.cae.wisc.edu/~ece533/images/arctichare.png",
        }}
      />
    </View>
  );
};

export default ProfilePicture;
